tion of the tax (that will be printed in invoices / quotes).\n5. Rate: Tax rate.\n6. Amount: Tax amount.\n7. Total: Cumulative total to this point.\n8. Enter Row: If based on \"Previous Row Total\" you can select the row number which will be taken as a base for this calculation (default is the previous row).\n9. Consider Tax or Charge for: In this section you can specify if the tax / charge is only for valuation (not a part of total) or only for total (does not add value to the item) or for both.\n10. Add or Deduct: Whether you want to add or deduct the tax.',NULL,0,0,NULL,NULL,NULL,0,1,1,0,0,0,NULL,0,0,'Setup','icon-money',NULL,NULL,NULL,NULL,0,NULL,0),('Quality Inspection','2013-04-30 13:13:03.000000','2015-11-16 06:29:54.786379','Administrator','Administrator',0,NULL,NULL,NULL,1,'item_code, report_date, purchase_receipt_no, delivery_note_no',0,0,'Buying',NULL,'naming_series:',NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,0,0,0,0,0,0,NULL,0,0,NULL,'icon-search',NULL,NULL,NULL,NULL,1,NULL,0),('Quality Inspection Reading','2013-02-22 01:27:43.000000','2015-11-16 06:29:54.873250','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,0,1,'Buying',NULL,'hash',NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,0,0,0,0,0,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0),('Quotation','2013-05-24 19:29:08.000000','2016-01-21 09:46:16.190080','Administrator','Administrator',0,NULL,NULL,NULL,1,'status,transaction_date,customer,lead,order_type',0,0,'Selling',NULL,'naming_series:',NULL,'title','modified','DESC',NULL,NULL,0,0,0,NULL,NULL,0,0,1,0,0,1,NULL,1,0,'Document','icon-shopping-cart',NULL,NULL,NULL,NULL,1,NULL,0),('Quotation Item','2013-03-07 11:42:57.000000','2015-11-16 06:29:55.206667','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,0,1,'Selling',NULL,'QUOD/.#####',NULL,NULL,'modified','DESC',NULL,NULL,0,0,NULL,NULL,NULL,0,0,0,0,0,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0),('Quotation Lost Reason','2013-01-10 16:34:24.000000','2015-11-16 06:29:55.325