s. This template can contain list of tax heads and also other expense / income heads like \"Shipping\", \"Insurance\", \"Handling\" etc.\n\n#### Note\n\nThe tax rate you define here will be the standard tax rate for all **Items**. If there are **Items** that have different rates, they must be added in the **Item Tax** table in the **Item** master.\n\n#### Description of Columns\n\n1. Calculation Type: \n    - This can be on **Net Total** (that is the sum of basic amount).\n    - **On Previous Row Total / Amount** (for cumulative taxes or charges). If you select this option, the tax will be applied as a percentage of the previous row (in the tax table) amount or total.\n    - **Actual** (as mentioned).\n2. Account Head: The Account ledger under which this tax will be booked\n3. Cost Center: If the tax / charge is an income (like shipping) or expense it needs to be booked against a Cost Center.\n4. Description: Description of the tax (that will be printed in invoices / quotes).\n5. Rate: Tax rate.\n6. Amount: Tax amount.\n7. Total: Cumulative total to this point.\n8. Enter Row: If based on \"Previous Row Total\" you can select the row number which will be taken as a base for this calculation (default is the previous row).\n9. Is this Tax included in Basic Rate?: If you check this, it means that this tax will not be shown below the item table, but will be included in the Basic Rate in your main item table. This is useful where you want give a flat price (inclusive of all taxes) price to customers.',NULL,0,0,NULL,NULL,NULL,0,1,1,0,0,0,NULL,0,0,'Setup','icon-money',NULL,NULL,NULL,NULL,0,NULL,0),('Sales Team','2013-04-19 13:30:51.000000','2015-11-16 06:29:57.395852','Administrator','Administrator',0,NULL,NULL,NULL,1,NULL,0,1,'Selling',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL,NULL,NULL,0,0,0,0,0,0,NULL,0,0,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,0),('Scheduler Log','2013-01-16 13:09:40.000000','2015-11-16 06:29:57.440897','Administrator','Administrator',0,NULL,NULL,NU