es And Contacts',0,NULL,'Yes',0,'SELECT\n	`tabCustomer`.name as \"Customer ID:Link/Customer\",\n	`tabCustomer`.customer_name as \"Customer Name\",\n	`tabCustomer`.customer_group as \"Customer Group:Link/Customer Group\",\n	`tabAddress`.address_line1 as \"Address Line 1\",\n	`tabAddress`.address_line2 as \"Address Line 2\",\n	`tabAddress`.city as \"City\",\n	`tabAddress`.state as \"State\",\n	`tabAddress`.pincode as \"Postal Code\",\n	`tabAddress`.country as \"Country\",\n	`tabAddress`.is_primary_address as \"Is Primary Address:Check\", \n	`tabContact`.first_name as \"First Name\",\n	`tabContact`.last_name as \"Last Name\",\n	`tabContact`.phone as \"Phone\",\n	`tabContact`.mobile_no as \"Mobile No\",\n	`tabContact`.email_id as \"Email Id\",\n	`tabContact`.is_primary_contact as \"Is Primary Contact:Check\"\nFROM\n	`tabCustomer`\n	left join `tabAddress` on (\n		`tabAddress`.customer=`tabCustomer`.name\n	)\n	left join `tabContact` on (\n		`tabContact`.customer=`tabCustomer`.name\n	)\nWHERE\n	`tabCustomer`.docstatus<2\nORDER BY\n	`tabCustomer`.name asc'),('Customer Credit Balance','2014-10-06 15:19:31.578162','2014-10-06 15:19:37.578616','Administrator','Administrator',0,NULL,NULL,NULL,0,1,NULL,'Script Report','Customer','Selling','Customer Credit Balance',0,NULL,'Yes',0,NULL),('Customers Not Buying Since Long Time','2013-06-07 12:27:07.000000','2014-06-03 07:18:17.013590','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Sales Order','Selling','Customers Not Buying Since Long Time ',0,NULL,'Yes',0,NULL),('Daily Time Log Summary','2013-04-03 11:27:52.000000','2014-06-03 07:18:17.019543','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Time Log','Projects','Daily Time Log Summary',0,NULL,'Yes',0,NULL),('Delivered Items To Be Billed','2013-07-30 17:28:49.000000','2015-11-02 12:32:02.048551','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Sales Invoice','Accounts','Delivered Items To Be Billed',0,NULL,'Yes',0,'select\n    `tabDelivery Note`.`name` as \"Delivery Note:Link/Delivery Note:120\",\n	`tabDelivery Note`.`customer` as \"Customer:Link/Customer:120\",\n	`tabDelivery Note`.`posting_date` as \"Date:Date\",\n	`tabDelivery Note`.`project_name` as \"Project\",\n	`tabDelivery Note Item`.`item_code` as \"Item:Link/Item:120\",\n	(`tabDelivery Note Item`.`qty` - ifnull((select sum(qty) from `tabSales Invoice Item` \n	    where `tabSales Invoice Item`.docstatus=1 and \n            `tabSales Invoice Item`.delivery_note = `tabDelivery Note`.name and\n	        `tabSales Invoice Item`.dn_detail = `tabDelivery Note Item`.name), 0))\n		as \"Qty:Float:110\",\n	(`tabDelivery Note Item`.`base_amount` - ifnull((select sum(base_amount) from `tabSales Invoice Item` \n        where `tabSales Invoice Item`.docstatus=1 and \n            `tabSales Invoice Item`.delivery_note = `tabDelivery Note`.name and\n            `tabSales Invoice Item`.dn_detail = `tabDelivery Note Item`.name), 0))\n		as \"Amount:Currency:110\",\n	`tabDelivery Note Item`.`item_name` as \"Item Name::150\",\n	`tabDelivery Note Item`.`description` as \"Description::200\",\n	`tabDelivery Note`.`company` as \"Company:Link/Company:\"\nfrom `tabDelivery Note`, `tabDelivery Note Item`\nwhere\n    `tabDelivery Note`.docstatus = 1 and\n	`tabDelivery Note`.`status` not in (\"Stopped\", \"Closed\") and\n    `tabDelivery Note`.name = `tabDelivery Note Item`.parent and\n    (`tabDelivery Note Item`.qty > ifnull((select sum(qty) from `tabSales Invoice Item` \n        where `tabSales Invoice Item`.docstatus=1 and \n            `tabSales Invoice Item`.delivery_note = `tabDelivery Note`.name and\n            `tabSales Invoice Item`.dn_detail = `tabDelivery Note Item`.name), 0))\norder by `tabDelivery Note`.`name` desc'),('Delivery Note Trends','2013-06-13 18:42:11.000000','2014-06-03 07:18:17.040345','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Delivery Note','Stock','Delivery Note Trends',0,NULL,'Yes',0,NULL),('Document Share Report','2015-02-05 06:01:35.060098','2015-02-05 06:01:52.870622','Administrator','Administrator',0,NULL,NULL,NULL,0,1,NULL,'Report Builder','DocShare','Core','Document Share Report',0,'{\"filters\":[],\"columns\":[[\"name\",\"DocShare\"],[\"user\",\"DocShare\"],[\"share_doctype\",\"DocShare\"],[\"share_name\",\"DocShare\"],[\"read\",\"DocShare\"],[\"write\",\"DocShare\"],[\"share\",\"DocShare\"]],\"sort_by\":\"DocShare.modified\",\"sort_order\":\"desc\",\"sort_by_next\":null,\"sort_order_next\":\"desc\"}','Yes',0,NULL),('Employee Birthday','2013-05-06 17:56:03.000000','2014-06-03 07:18:17.045541','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Employee','HR','Employee Birthday',0,NULL,'Yes',0,NULL),('Employee Information','2013-05-06 18:43:53.000000','2015-03-02 07:42:02.352823','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Report Builder','Employee','HR','Employee Information',0,'{\"filters\":[],\"columns\":[[\"name\",\"Employee\"],[\"employee_number\",\"Employee\"],[\"date_of_joining\",\"Employee\"],[\"branch\",\"Employee\"],[\"department\",\"Employee\"],[\"designation\",\"Employee\"],[\"gender\",\"Employee\"],[\"status\",\"Employee\"],[\"company\",\"Employee\"],[\"employment_type\",\"Employee\"],[\"reports_to\",\"Employee\"],[\"company_email\",\"Employee\"]],\"sort_by\":\"Employee.bank_ac_no\",\"sort_order\":\"desc\",\"sort_by_next\":\"\",\"sort_order_next\":\"desc\"}','Yes',0,NULL),('Employee Leave Balance','2013-02-22 15:29:34.000000','2014-06-03 07:18:17.066168','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Employee','HR','Employee Leave Balance',0,NULL,'Yes',0,NULL),('General Ledger','2013-12-06 13:22:23.000000','2014-06-03 07:18:17.072046','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','GL Entry','Accounts','General Ledger',0,NULL,'Yes',0,NULL),('Gross Profit','2013-02-25 17:03:34.000000','2014-09-18 19:00:50.263854','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Sales Invoice','Accounts','Gross Profit',0,NULL,'Yes',0,NULL),('Issued Items Against Production Order','2013-05-03 17:48:46.000000','2015-03-30 05:43:20.932301','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Production Order','Manufacturing','Issued Items Against Production Order',0,NULL,'Yes',0,'select\n    ste.production_order as \"Production Order:Link/Production Order:120\",\n    ste.posting_date as \"Issue Date:Date:140\",\n    ste_item.item_code as \"Item Code:Link/Item:120\",\n	ste_item.description as \"Description::150\",\n	ste_item.transfer_qty as \"Qty:Float:100\",\n	ste_item.stock_uom as \"UOM:Link/UOM:80\",\n	ste_item.amount as \"Amount:Currency:120\",\n	ste_item.serial_no as \"Serial No:Link/Serial No:80\",\n	ste_item.s_warehouse as \"Source Warehouse:Link/Warehouse:120\",\n	ste_item.t_warehouse as \"Target Warehouse:Link/Warehouse:120\",\n	pro.production_item as \"Finished Goods:Link/Item:120\", \n	ste.name as \"Stock Entry:Link/Stock Entry:120\",\n	ste.company as \"Company:Link/Company:\"\nfrom\n	`tabStock Entry` ste, `tabStock Entry Detail` ste_item, `tabProduction Order` pro\nwhere\n	ifnull(ste.production_order, \'\') != \'\' and ste.name = ste_item.parent \n	and ste.production_order = pro.name and ste.docstatus = 1 \n	and ste.purpose = \'Manufacture\' or \'Repack\'\norder by ste.posting_date, ste.production_order, ste_item.item_code'),('Item Prices','2013-06-05 11:43:30.000000','2014-06-03 07:18:17.087582','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Stock Ledger Entry','Stock','Item Prices',0,NULL,'Yes',0,NULL),('Item Shortage Report','2013-08-20 13:43:30.000000','2014-06-03 07:18:17.092713','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Report Builder','Bin','Stock','Item Shortage Report',0,'{\"filters\":[[\"Bin\",\"projected_qty\",\"<\",\"0\"]],\"columns\":[[\"warehouse\",\"Bin\"],[\"item_code\",\"Bin\"],[\"actual_qty\",\"Bin\"],[\"ordered_qty\",\"Bin\"],[\"planned_qty\",\"Bin\"],[\"reserved_qty\",\"Bin\"],[\"projected_qty\",\"Bin\"]],\"sort_by\":\"Bin.projected_qty\",\"sort_order\":\"asc\",\"sort_by_next\":\"\",\"sort_order_next\":\"desc\"}','Yes',0,NULL),('Item-wise Price List Rate','2013-09-25 10:21:15.000000','2014-06-09 10:21:15.097955','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Report Builder','Price List','Stock','Item-wise Price List Rate',0,'{\"filters\":[[\"Item Price\",\"price_list\",\"like\",\"%\"],[\"Item Price\",\"item_code\",\"like\",\"%\"]],\"columns\":[[\"name\",\"Item Price\"],[\"price_list\",\"Item Price\"],[\"item_code\",\"Item Price\"],[\"item_name\",\"Item Price\"],[\"item_description\",\"Item Price\"],[\"price_list_rate\",\"Item Price\"],[\"buying\",\"Item Price\"],[\"selling\",\"Item Price\"],[\"currency\",\"Item Price\"]],\"sort_by\":\"Item Price.modified\",\"sort_order\":\"desc\",\"sort_by_next\":\"\",\"sort_order_next\":\"desc\"}','Yes',0,NULL),('Item-wise Purchase History','2013-05-03 14:55:53.000000','2015-03-30 05:39:39.876374','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Purchase Order','Buying','Item-wise Purchase History',0,NULL,'Yes',1,'select\n    po_item.item_code as \"Item Code:Link/Item:120\",\n	po_item.item_name as \"Item Name::120\",\n	po_item.description as \"Description::150\",\n	po_item.qty as \"Qty:Float:100\",\n	po_item.stock_uom as \"UOM:Link/UOM:80\",\n	po_item.base_rate as \"Rate:Currency:120\",\n	po_item.base_amount as \"Amount:Currency:120\",\n	po.name as \"Purchase Order:Link/Purchase Order:120\",\n	po.transaction_date as \"Transaction Date:Date:140\",\n	po.supplier as \"Supplier:Link/Supplier:130\",\n	po_item.project_name as \"Project:Link/Project:130\",\n	ifnull(po_item.received_qty, 0) as \"Received Qty:Float:120\",\n	po.company as \"Company:Link/Company:\"\nfrom\n	`tabPurchase Order` po, `tabPurchase Order Item` po_item\nwhere\n	po.name = po_item.parent and po.docstatus = 1\norder by po.name desc'),('Item-wise Purchase Register','2013-06-05 15:37:30.000000','2014-06-03 07:18:17.113416','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Purchase Invoice','Accounts','Item-wise Purchase Register',0,NULL,'Yes',1,NULL),('Item-wise Sales History','2013-05-23 17:42:24.000000','2015-03-30 05:45:04.934308','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Sales Order','Selling','Item-wise Sales History',0,NULL,'Yes',1,'select\n    so_item.item_code as \"Item Code:Link/Item:120\",\n	so_item.item_name as \"Item Name::120\",\n	so_item.description as \"Description::150\",\n	so_item.qty as \"Qty:Float:100\",\n	so_item.stock_uom as \"UOM:Link/UOM:80\",\n	so_item.base_rate as \"Rate:Currency:120\",\n	so_item.base_amount as \"Amount:Currency:120\",\n	so.name as \"Sales Order:Link/Sales Order:120\",\n	so.transaction_date as \"Transaction Date:Date:140\",\n	so.customer as \"Customer:Link/Customer:130\",\n	so.territory as \"Territory:Link/Territory:130\",\n    so.project_name as \"Project:Link/Project:130\",\n	ifnull(so_item.delivered_qty, 0) as \"Delivered Qty:Float:120\",\n	ifnull(so_item.billed_amt, 0) as \"Billed Amount:Currency:120\",\n	so.company as \"Company:Link/Company:\"\nfrom\n	`tabSales Order` so, `tabSales Order Item` so_item\nwhere\n	so.name = so_item.parent\n	and so.docstatus = 1\norder by so.name desc'),('Item-wise Sales Register','2013-05-13 17:50:55.000000','2014-06-03 07:18:17.123848','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Sales Invoice','Accounts','Item-wise Sales Register',0,NULL,'Yes',1,NULL),('Items To Be Requested','2013-08-20 15:08:10.000000','2014-06-03 07:18:17.128918','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Item','Stock','Items To Be Requested',0,NULL,'Yes',0,'SELECT\n    tabBin.item_code as \"Item:Link/Item:120\",\n    tabBin.warehouse as \"Warehouse:Link/Warehouse:120\",\n    tabBin.actual_qty as \"Actual:Float:90\",\n    tabBin.indented_qty as \"Requested:Float:90\",\n    tabBin.reserved_qty as \"Reserved:Float:90\",\n    tabBin.ordered_qty as \"Ordered:Float:90\",\n    tabBin.projected_qty as \"Projected:Float:90\"\nFROM\n    tabBin, tabItem\nWHERE\n    tabBin.item_code = tabItem.name\n    AND tabItem.is_purchase_item = 1\n    AND tabBin.projected_qty < 0\nORDER BY\n    tabBin.projected_qty ASC'),('Itemwise Recommended Reorder Level','2013-06-07 12:47:22.000000','2014-06-03 07:18:17.134165','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Item','Stock','Itemwise Recommended Reorder Level',0,NULL,'Yes',0,NULL),('Lead Details','2013-10-22 11:58:16.000000','2015-02-02 11:39:57.231750','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Lead','Selling','Lead Details',0,NULL,'Yes',0,'SELECT\n    `tabLead`.name as \"Lead Id:Link/Lead:120\",\n    `tabLead`.lead_name as \"Lead Name::120\",\n	`tabLead`.company_name as \"Company Name::120\",\n	`tabLead`.status as \"Status::120\",\n	concat_ws(\', \', \n		trim(\',\' from `tabAddress`.address_line1), \n		trim(\',\' from tabAddress.address_line2)\n	) as \'Address::180\',\n	`tabAddress`.state as \"State::100\",\n	`tabAddress`.pincode as \"Pincode::70\",\n	`tabAddress`.country as \"Country::100\",\n	`tabLead`.phone as \"Phone::100\",\n	`tabLead`.mobile_no as \"Mobile No::100\",\n	`tabLead`.email_id as \"Email Id::120\",\n	`tabLead`.lead_owner as \"Lead Owner::120\",\n	`tabLead`.source as \"Source::120\",\n	`tabLead`.territory as \"Territory::120\",\n    `tabLead`.owner as \"Owner:Link/User:120\"\nFROM\n	`tabLead`\n	left join `tabAddress` on (\n		`tabAddress`.lead=`tabLead`.name\n	)\nWHERE\n	`tabLead`.docstatus<2\nORDER BY\n	`tabLead`.name asc'),('Maintenance Schedules','2013-05-06 14:25:21.000000','2014-06-03 07:18:17.144598','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Maintenance Schedule','Support','Maintenance Schedules',0,NULL,'Yes',0,'SELECT\n    ms_sch.scheduled_date as \"Schedule Date:Date:120\",\n	ms_sch.item_code as \"Item Code:Link/Item:120\",\n	ms_sch.item_name as \"Item Name::120\",\n	ms_sch.serial_no as \"Serial No::120\",\n	ms_sch.sales_person as \"Sales Person::120\",\n	ms.customer_name as \"Customer:Link/Customer:120\",\n	ms.address_display as \"Customer Address::120\",\n	ms_item.prevdoc_docname as \"Sales Order:Link/Sales Order:120\",\n	ms.company as \"Company:Link/Company:120\"\n	\nFROM\n	`tabMaintenance Schedule` ms, \n    `tabMaintenance Schedule Detail` ms_sch, \n    `tabMaintenance Schedule Item` ms_item\nWHERE\n	ms.name = ms_sch.parent and ms.name = ms_item.parent and ms.docstatus = 1\nORDER BY\n	ms_sch.scheduled_date asc, ms_sch.item_code asc'),('Material Requests for which Supplier Quotations are not created','2013-08-09 12:20:58.000000','2015-03-30 05:46:11.917037','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Material Request','Stock','Material Requests for which Supplier Quotations are not created',0,NULL,'Yes',0,'select \n    mr.name as \"Material Request:Link/Material Request:120\",\n    mr.transaction_date as \"Date:Date:100\",\n	mr_item.item_code as \"Item Code:Link/Item:120\",\n	mr_item.qty as \"Qty:Float:100\",\n	mr_item.item_name as \"Item Name::150\",\n	mr_item.description as \"Description::200\",\n	mr.company as \"Company:Link/Company:\"\nfrom\n	`tabMaterial Request` mr, `tabMaterial Request Item` mr_item\nwhere\n	mr_item.parent = mr.name\n	and mr.material_request_type = \"Purchase\"\n	and mr.docstatus = 1\n	and mr.status != \"Stopped\"\n	and not exists(select name from `tabSupplier Quotation Item` where prevdoc_docname=mr.name)\norder by mr.transaction_date asc'),('Monthly Attendance Sheet','2013-05-13 14:04:03.000000','2014-06-03 07:18:17.181332','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Attendance','HR','Monthly Attendance Sheet',0,NULL,'Yes',0,NULL),('Monthly Salary Register','2013-05-07 18:09:42.000000','2014-06-03 07:18:17.187018','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Salary Slip','HR','Monthly Salary Register',0,NULL,'Yes',1,NULL),('Open Production Orders','2013-08-12 12:32:30.000000','2015-05-15 05:43:59.976254','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Production Order','Manufacturing','Open Production Orders',0,NULL,'Yes',0,'SELECT\n  `tabProduction Order`.name as \"Production Order:Link/Production Order:200\",\n  `tabProduction Order`.creation as \"Date:Date:120\",\n  `tabProduction Order`.production_item as \"Item:Link/Item:150\",\n  `tabProduction Order`.qty as \"To Produce:Int:100\",\n  `tabProduction Order`.produced_qty as \"Produced:Int:100\",\n  `tabProduction Order`.company as \"Company:Link/Company:\"\nFROM\n  `tabProduction Order`\nWHERE\n  `tabProduction Order`.docstatus=1\n  AND ifnull(`tabProduction Order`.produced_qty,0) < `tabProduction Order`.qty\n  AND NOT EXISTS (SELECT name from `tabStock Entry` where production_order =`tabProduction Order`.name) '),('Ordered Items To Be Billed','2013-02-21 14:26:44.000000','2015-11-04 11:56:32.699103','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Sales Invoice','Accounts','Ordered Items To Be Billed',0,NULL,'Yes',0,'select \n `tabSales Order`.`name` as \"Sales Order:Link/Sales Order:120\",\n `tabSales Order`.`customer` as \"Customer:Link/Customer:120\",\n `tabSales Order`.`status` as \"Status\",\n `tabSales Order`.`transaction_date` as \"Date:Date\",\n `tabSales Order`.`project_name` as \"Project\",\n `tabSales Order Item`.item_code as \"Item:Link/Item:120\",\n `tabSales Order Item`.base_amount as \"Amount:Currency:110\",\n (`tabSales Order Item`.billed_amt * ifnull(`tabSales Order`.conversion_rate, 1)) as \"Billed Amount:Currency:110\",\n (ifnull(`tabSales Order Item`.base_amount, 0) - (ifnull(`tabSales Order Item`.billed_amt, 0) * ifnull(`tabSales Order`.conversion_rate, 1))) as \"Pending Amount:Currency:120\",\n `tabSales Order Item`.item_name as \"Item Name::150\",\n `tabSales Order Item`.description as \"Description::200\",\n `tabSales Order`.`company` as \"Company:Link/Company:\"\nfrom\n `tabSales Order`, `tabSales Order Item`\nwhere\n `tabSales Order Item`.`parent` = `tabSales Order`.`name`\n and `tabSales Order`.docstatus = 1\n and `tabSales Order`.status not in (\"Stopped\", \"Closed\")\n and ifnull(`tabSales Order Item`.billed_amt,0) < ifnull(`tabSales Order Item`.amount,0)\norder by `tabSales Order`.transaction_date asc'),('Ordered Items To Be Delivered','2013-02-22 18:01:55.000000','2015-11-04 12:00:40.085130','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Delivery Note','Stock','Ordered Items To Be Delivered',0,NULL,'Yes',0,'select \n `tabSales Order`.`name` as \"Sales Order:Link/Sales Order:120\",\n `tabSales Order`.`customer` as \"Customer:Link/Customer:120\",\n `tabSales Order`.`transaction_date` as \"Date:Date\",\n `tabSales Order`.`project_name` as \"Project\",\n `tabSales Order Item`.item_code as \"Item:Link/Item:120\",\n `tabSales Order Item`.qty as \"Qty:Float:140\",\n `tabSales Order Item`.delivered_qty as \"Delivered Qty:Float:140\",\n (`tabSales Order Item`.qty - ifnull(`tabSales Order Item`.delivered_qty, 0)) as \"Qty to Deliver:Float:140\",\n `tabSales Order Item`.base_rate as \"Rate:Float:140\",\n `tabSales Order Item`.base_amount as \"Amount:Float:140\",\n ((`tabSales Order Item`.qty - ifnull(`tabSales Order Item`.delivered_qty, 0))*`tabSales Order Item`.base_rate) as \"Amount to Deliver:Float:140\",\n `tabBin`.actual_qty as \"Available Qty:Float:120\",\n `tabBin`.projected_qty as \"Projected Qty:Float:120\",\n `tabSales Order`.`delivery_date` as \"Expected Delivery Date:Date:120\",\n `tabSales Order Item`.item_name as \"Item Name::150\",\n `tabSales Order Item`.description as \"Description::200\",\n `tabSales Order Item`.item_group as \"Item Group:Link/Item Group:120\",\n `tabSales Order Item`.warehouse as \"Warehouse:Link/Warehouse:200\"\nfrom\n `tabSales Order` JOIN `tabSales Order Item` \n LEFT JOIN `tabBin` ON (`tabBin`.item_code = `tabSales Order Item`.item_code\n and `tabBin`.warehouse = `tabSales Order Item`.warehouse)\nwhere\n `tabSales Order Item`.`parent` = `tabSales Order`.`name`\n and `tabSales Order`.docstatus = 1\n and `tabSales Order`.status not in (\"Stopped\", \"Closed\")\n and ifnull(`tabSales Order Item`.delivered_qty,0) < ifnull(`tabSales Order Item`.qty,0)\norder by `tabSales Order`.transaction_date asc'),('Payment Period Based On Invoice Date','2013-12-02 17:06:37.000000','2014-06-03 07:18:17.207997','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Journal Entry','Accounts','Payment Period Based On Invoice Date',0,NULL,'Yes',1,NULL),('Pending SO Items For Purchase Request','2013-06-21 16:46:45.000000','2015-10-06 12:43:48.259027','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Sales Order','Selling','Pending SO Items For Purchase Request',0,NULL,'Yes',0,'select  so_item.item_code as \"Item Code:Link/Item:120\",\n so_item.item_name as \"Item Name::120\",\n so_item.description as \"Description::120\",\n so.`name` as \"S.O. No.:Link/Sales Order:120\",\n so.`transaction_date` as \"Date:Date:120\",\n mr.name as \"Material Request:Link/Material Request:120\",\n so.customer as \"Customer:Link/Customer:120\",\n so.territory as \"Terretory:Link/Territory:120\",\n sum(so_item.qty) as \"SO Qty:Float:100 \",\n sum(mr_item.qty) as \"Requested Qty:Float:100\",\n sum(so_item.qty) - sum(mr_item.qty) as \"Pending Qty:Float:100 \", \n so.company as \"Company:Link/Company:\"\nfrom\n `tabSales Order` so, `tabSales Order Item` so_item, \n `tabMaterial Request` mr, `tabMaterial Request Item` mr_item\nwhere \n so_item.`parent` = so.`name` \n and mr_item.parent = mr.name\n and mr_item.sales_order_no = so.name\n and mr_item.item_code = so_item.item_code\n and so.docstatus = 1 and so.status != \"Stopped\" \n and mr.docstatus = 1 and mr.status != \"Stopped\"\ngroup by so.name, so_item.item_code\nhaving sum(so_item.qty) > sum(mr_item.qty)\norder by so.name desc, so_item.item_code asc'),('Permitted Documents For User','2014-06-03 05:20:35.218263','2014-06-03 07:18:17.218526','Administrator','Administrator',0,NULL,NULL,NULL,0,1,NULL,'Script Report','User','Core','Permitted Documents For User',0,NULL,'Yes',0,NULL),('Production Orders in Progress','2013-08-12 12:43:47.000000','2015-03-30 05:44:32.894553','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Production Order','Manufacturing','Production Orders in Progress',0,NULL,'Yes',0,'SELECT\n  `tabProduction Order`.name as \"Production Order:Link/Production Order:200\",\n  `tabProduction Order`.creation as \"Date:Date:120\",\n  `tabProduction Order`.production_item as \"Item:Link/Item:150\",\n  `tabProduction Order`.qty as \"To Produce:Int:100\",\n  `tabProduction Order`.produced_qty as \"Produced:Int:100\",\n  `tabProduction Order`.company as \"Company:Link/Company:\"\nFROM\n  `tabProduction Order`\nWHERE\n  `tabProduction Order`.docstatus=1\n  AND ifnull(`tabProduction Order`.produced_qty,0) < `tabProduction Order`.qty\n  AND EXISTS (SELECT name from `tabStock Entry` where production_order =`tabProduction Order`.name) '),('Profit and Loss Statement','2014-07-18 11:43:33.173207','2014-07-18 11:43:33.173207','Administrator','Administrator',0,NULL,NULL,NULL,0,1,NULL,'Script Report','GL Entry','Accounts','Profit and Loss Statement',0,NULL,'Yes',0,NULL),('Project wise Stock Tracking','2013-06-03 17:37:41.000000','2014-06-03 07:18:17.229116','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Report Builder','Project','Projects','Project wise Stock Tracking ',0,NULL,'Yes',0,NULL),('Purchase Invoice Trends','2013-06-13 18:46:55.000000','2014-06-03 07:18:17.239496','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Purchase Invoice','Accounts','Purchase Invoice Trends',0,NULL,'Yes',0,NULL),('Purchase Order Items To Be Billed','2013-05-28 15:54:16.000000','2015-11-04 11:56:14.321664','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Purchase Invoice','Accounts','Purchase Order Items To Be Billed',0,NULL,'Yes',1,'select \n    `tabPurchase Order`.`name` as \"Purchase Order:Link/Purchase Order:120\",\n    `tabPurchase Order`.`transaction_date` as \"Date:Date:100\",\n	`tabPurchase Order`.`supplier` as \"Supplier:Link/Supplier:120\",\n	`tabPurchase Order Item`.`project_name` as \"Project\",\n	`tabPurchase Order Item`.item_code as \"Item Code:Link/Item:120\",\n	`tabPurchase Order Item`.base_amount as \"Amount:Currency:100\",\n	(`tabPurchase Order Item`.billed_amt * ifnull(`tabPurchase Order`.conversion_rate, 1)) as \"Billed Amount:Currency:100\", \n	(`tabPurchase Order Item`.base_amount - (ifnull(`tabPurchase Order Item`.billed_amt, 0) * ifnull(`tabPurchase Order`.conversion_rate, 1))) as \"Amount to Bill:Currency:100\",\n	`tabPurchase Order Item`.item_name as \"Item Name::150\",\n	`tabPurchase Order Item`.description as \"Description::200\",\n	`tabPurchase Order`.company as \"Company:Link/Company:\"\nfrom\n	`tabPurchase Order`, `tabPurchase Order Item`\nwhere\n	`tabPurchase Order Item`.`parent` = `tabPurchase Order`.`name`\n	and `tabPurchase Order`.docstatus = 1\n	and `tabPurchase Order`.status not in (\"Stopped\", \"Closed\")\n	and (ifnull(`tabPurchase Order Item`.billed_amt, 0) * ifnull(`tabPurchase Order`.conversion_rate, 1)) < ifnull(`tabPurchase Order Item`.base_amount, 0)\norder by `tabPurchase Order`.transaction_date asc'),('Purchase Order Items To Be Received','2013-02-22 18:01:55.000000','2015-11-04 12:01:22.108641','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Purchase Receipt','Stock','Purchase Order Items To Be Received',0,NULL,'Yes',1,'select \n    `tabPurchase Order`.`name` as \"Purchase Order:Link/Purchase Order:120\",\n	`tabPurchase Order`.`transaction_date` as \"Date:Date:100\",\n	`tabPurchase Order Item`.`schedule_date` as \"Reqd by Date:Date:110\",\n	`tabPurchase Order`.`supplier` as \"Supplier:Link/Supplier:120\",\n	`tabPurchase Order Item`.`project_name` as \"Project\",\n	`tabPurchase Order Item`.item_code as \"Item Code:Link/Item:120\",\n	`tabPurchase Order Item`.qty as \"Qty:Float:100\",\n	`tabPurchase Order Item`.received_qty as \"Received Qty:Float:100\", \n	(`tabPurchase Order Item`.qty - ifnull(`tabPurchase Order Item`.received_qty, 0)) as \"Qty to Receive:Float:100\",\n    `tabPurchase Order Item`.warehouse as \"Warehouse:Link/Warehouse:150\",\n	`tabPurchase Order Item`.item_name as \"Item Name::150\",\n	`tabPurchase Order Item`.description as \"Description::200\",\n    `tabPurchase Order Item`.brand as \"Brand::100\",\n	`tabPurchase Order`.`company` as \"Company:Link/Company:\"\nfrom\n	`tabPurchase Order`, `tabPurchase Order Item`\nwhere\n	`tabPurchase Order Item`.`parent` = `tabPurchase Order`.`name`\n	and `tabPurchase Order`.docstatus = 1\n	and `tabPurchase Order`.status not in (\"Stopped\", \"Closed\")\n	and ifnull(`tabPurchase Order Item`.received_qty, 0) < ifnull(`tabPurchase Order Item`.qty, 0)\norder by `tabPurchase Order`.transaction_date asc'),('Purchase Order Trends','2013-06-13 18:45:01.000000','2014-06-03 07:18:17.255067','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Purchase Order','Buying','Purchase Order Trends',0,NULL,'Yes',0,NULL),('Purchase Receipt Trends','2013-06-13 18:45:44.000000','2014-06-03 07:18:17.260182','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Purchase Receipt','Stock','Purchase Receipt Trends',0,NULL,'Yes',0,NULL),('Purchase Register','2013-04-29 16:13:11.000000','2014-06-03 07:18:17.265444','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Purchase Invoice','Accounts','Purchase Register',0,NULL,'Yes',1,NULL),('Quotation Trends','2013-06-07 16:01:16.000000','2014-06-03 07:18:17.270656','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Script Report','Quotation','Selling','Quotation Trends',0,NULL,'Yes',0,NULL),('Received Items To Be Billed','2013-07-30 18:35:10.000000','2015-11-02 12:33:11.681513','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Purchase Invoice','Accounts','Received Items To Be Billed',0,NULL,'Yes',0,'select\n    `tabPurchase Receipt`.`name` as \"Purchase Receipt:Link/Purchase Receipt:120\",\n    `tabPurchase Receipt`.`supplier` as \"Supplier:Link/Supplier:120\",\n	`tabPurchase Receipt`.`posting_date` as \"Date:Date\",\n	`tabPurchase Receipt Item`.`project_name` as \"Project\",\n	`tabPurchase Receipt Item`.`item_code` as \"Item:Link/Item:120\",\n	(`tabPurchase Receipt Item`.`qty` - ifnull((select sum(qty) from `tabPurchase Invoice Item` \n	    where `tabPurchase Invoice Item`.purchase_receipt = `tabPurchase Receipt`.name and\n            `tabPurchase Invoice Item`.docstatus = 1 and\n	    `tabPurchase Invoice Item`.pr_detail = `tabPurchase Receipt Item`.name), 0))\n	    as \"Qty:Float:110\",\n	(`tabPurchase Receipt Item`.`base_amount` - ifnull((select sum(base_amount) \n             from `tabPurchase Invoice Item` \n             where `tabPurchase Invoice Item`.purchase_receipt = `tabPurchase Receipt`.name and\n            `tabPurchase Invoice Item`.docstatus = 1 and\n            `tabPurchase Invoice Item`.pr_detail = `tabPurchase Receipt Item`.name), 0))\n	    as \"Amount:Currency:110\",\n	`tabPurchase Receipt Item`.`item_name` as \"Item Name::150\",\n	`tabPurchase Receipt Item`.`description` as \"Description::200\",\n	`tabPurchase Receipt`.`company` as \"Company:Link/Company:\"\nfrom `tabPurchase Receipt`, `tabPurchase Receipt Item`\nwhere\n    `tabPurchase Receipt`.docstatus = 1 and `tabPurchase Receipt`.status != \"Closed\" and \n    `tabPurchase Receipt`.name = `tabPurchase Receipt Item`.parent and\n    (`tabPurchase Receipt Item`.qty > ifnull((select sum(qty) from `tabPurchase Invoice Item` \n        where `tabPurchase Invoice Item`.purchase_receipt = `tabPurchase Receipt`.name and\n            `tabPurchase Invoice Item`.docstatus=1 and \n            `tabPurchase Invoice Item`.pr_detail = `tabPurchase Receipt Item`.name), 0))\norder by `tabPurchase Receipt`.`name` desc'),('Requested Items To Be Ordered','2013-05-13 16:10:02.000000','2015-03-30 05:41:52.889977','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Purchase Order','Buying','Requested Items To Be Ordered',0,NULL,'Yes',1,'select \n    mr.name as \"Material Request:Link/Material Request:120\",\n	mr.transaction_date as \"Date:Date:100\",\n	mr_item.item_code as \"Item Code:Link/Item:120\",\n	sum(ifnull(mr_item.qty, 0)) as \"Qty:Float:100\",\n	sum(ifnull(mr_item.ordered_qty, 0)) as \"Ordered Qty:Float:100\", \n	(sum(mr_item.qty) - sum(ifnull(mr_item.ordered_qty, 0))) as \"Qty to Order:Float:100\",\n	mr_item.item_name as \"Item Name::150\",\n	mr_item.description as \"Description::200\",\n	mr.company as \"Company:Link/Company:\"\nfrom\n	`tabMaterial Request` mr, `tabMaterial Request Item` mr_item\nwhere\n	mr_item.parent = mr.name\n	and mr.material_request_type = \"Purchase\"\n	and mr.docstatus = 1\n	and mr.status != \"Stopped\"\ngroup by mr.name, mr_item.item_code\nhaving\n	sum(ifnull(mr_item.ordered_qty, 0)) < sum(ifnull(mr_item.qty, 0))\norder by mr.transaction_date asc'),('Requested Items To Be Transferred','2013-05-13 16:23:05.000000','2015-03-30 05:47:31.113927','Administrator','Administrator',0,NULL,NULL,NULL,1,1,NULL,'Query Report','Stock Entry','Stock','Requested Items To Be Transferred',0,NULL,'Yes',1,'select \n    mr.name as \"Material Request:Link/Material Request:120\",\n	mr.transaction_date as \"Date:Date:100\",\n	mr_item.item_code as \"Item Code:Link/Item:120\",\n	mr_item.qty as \"Qty:Float:100\",\n	mr_item.ordered_qty as \"Transferred Qty:Float:100\", \n	(mr_item.qty - ifnull(mr_item.ordered_qty, 0)) as \"Qty to Transfer:Float:100\",\n	mr_item.item_name as \"Item Name::150\",\n	mr_item.description as \"Description::200\",\n	mr